import React from 'react';

function Sum37() {
	return (
		<div className="page">
			<h1>SUM37</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>SUM37는 프리미엄 화장품 브랜드 디자인 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>프리미엄 패키지 디자인</li>
					<li>브랜드 컨셉 개발</li>
					<li>제품 카탈로그 디자인</li>
					<li>매장 인테리어 디자인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Creative Suite, 3D Modeling, Figma</p>
			</div>
		</div>
	);
}

export default Sum37;
